import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "./styles.css"
// import Hello from "./components/Hello";
import Navbar from "./components/Navbar";
// import TopBar from './components/TopBar';
// import TitleHeadline from "./components/TitleHeadline";
// import MoneyPrinterLogo from "./components/MoneyPrinterLogo";
import { Button, Container } from "react-bootstrap";

const Home = () => <div className="page">Home Page</div>;
const About = () => <div className="page">About Page</div>;

function App() {
  return (
    // <Router>
    //   <Navbar />
    //     <Routes>
    //       <Route path="/" element={<Home />} />
    //       <Route path="/about" element={<About />} />
    //     </Routes>
    // </Router>

    <div className="frame1">
      <div className="moneyPrinterLogo"></div>
      <div className="printerSprite"></div>
      <div className="titleMoneyPrinter">The Money Printer</div>
      <div className="navHome">Home</div>
      <div className="navAbout">About</div>
      <div className="rectangle1"></div>
      <div className="buttonGetStarted">Get Started</div>
      <div className="headline">
        The Money Printer: The premier platform for sports betting arbitrage.
      </div>
      <div className="line1"></div>
      <div className="paragraph">
        Welcome to The Money Printer, your ultimate destination to guaranteed returns from your favorite activity. Our cutting-edge platform empowers you to capitalize on the dynamic odds and maximize your profits with our comprehensive analysis and real-time updates.
      </div>
      <div className="rectangle2"></div>
      <div className="buttonExploreSports">Explore Sports</div>
    </div>

  );
}

export default App;
